        <div className="form">
            <button > Add New </button>
       
            <div>
                <h3>ADD YOUR VIDEO</h3>
                <input type="text" ref={title} placeholder=""/>
                <input type="text" ref={url} placeholder=""/>


                <button></button>
            </div>
         </div>

    )
}



 export default Add
